/* eslint-disable prettier/prettier */
import React, { useEffect } from 'react';
import { Button, Col, Form, Input, notification, Row, Select } from 'antd';
import { Option } from 'antd/lib/mentions';
import TextArea from 'antd/lib/input/TextArea';

import { Link } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { Cards } from '../../components/cards/frame/cards-frame';
import { PageHeader } from '../../components/page-headers/page-headers';
import { FormValidationWrap, VerticalFormStyleWrap } from '../forms/overview/Style';
import { Main } from '../styled';
import { addNewNews } from '../../redux/news/actionCreator';
import { useSelector } from 'react-redux';

const AddNews = () => {
    const [form] = Form.useForm();
    const dispatch = useDispatch();
    const { errorMessage } = useSelector(state => state.News)

    const openNotificationWithIcon = type => {
        notification[type]({
            message: 'Notification',
            description: errorMessage
        });
    };

    useEffect(() => {
        if (errorMessage) {

            if (errorMessage?.responseCode === 200) {
                openNotificationWithIcon('success');
            }
            else {
                openNotificationWithIcon('error');
            }
        }
    }, [errorMessage]);

    const getvalue = async (values) => {
        const { title, description, categorySelect } = values;
        dispatch(addNewNews({
            category: categorySelect,
            title,
            description,
        }));
    }

    return (
        <>
            <PageHeader
                ghost
                title="Add News"
                buttons={[
                    <Button className="btn-add_new" size="default" type="primary" key="1">
                        {/* <Link to="/admin/listAdvertisement">List Advertisement</Link> */}
                    </Button>,
                ]}
            />

            <Main>
                <Row gutter={25}>
                    <Col xs={24}>
                        <FormValidationWrap>
                            <VerticalFormStyleWrap>
                                <Cards>
                                    <Form name="sDash_validation-form" form={form} layout="vertical" onFinish={getvalue}>
                                        <Row gutter={30}>
                                            <Col md={12} xs={24}>
                                                <Form.Item
                                                    name="categorySelect"
                                                    label="Category"
                                                    rules={[{ required: true, message: 'Ad Type required!' }]}
                                                >
                                                    <Select size="large" className="sDash_fullwidth-select" placeholder="Select category">
                                                        <Option value="Product">Product</Option>
                                                        <Option value="Company">Company</Option>
                                                        <Option value="Announcement">Announcement</Option>
                                                        <Option value="Bug Fix">Bug Fix</Option>
                                                    </Select>
                                                </Form.Item>
                                            </Col>

                                            <Col md={12} xs={24}>
                                                <Form.Item
                                                    name="title"
                                                    label="Title"
                                                    rules={[
                                                        { required: true, message: 'First Name required!' },
                                                        { min: 10, message: 'must be at least 10 characters!' },
                                                    ]}
                                                >
                                                    <Input placeholder="Enter title" />
                                                </Form.Item>
                                            </Col>
                                        </Row>
                                        <Row gutter={30}>
                                            <Col xs={24}>

                                                <div className="sDash_agree-check">
                                                    <Form.Item name="description" label="Description" rules={[{ required: true, message: 'Description required!' }, { min: 10, message: 'must be at least 10 characters!' }]}>
                                                        <TextArea className="sDash_unresizable" placeholder='Enter Description' />
                                                    </Form.Item>
                                                </div>
                                            </Col>
                                        </Row>

                                        <div className="sDash_form-action mt-20">
                                            <Button htmlType="submit" type="primary" size="large">
                                                Submit Form
                                            </Button>
                                        </div>
                                    </Form>
                                </Cards>
                            </VerticalFormStyleWrap>
                        </FormValidationWrap>
                    </Col>
                </Row>
            </Main>
        </>
    );
};

export default AddNews;
